TITLE:
  - "Test case for electrode-electrolyte interface coupling involving lithium plating:"
  - "- based on geometry in Goldin et al., Electrochimica Acta 64 (2012) 118-129"
  - "- three-dimensional problem with two two-dimensional electrode-electrolyte interfaces"
  - "- spherical anode particle, electrolyte, and spherical cathode particle, each with"
  - "constant initial lithium concentrations and electric potentials"
  - "- charge transfer and lithium plating kinetics characterized by Butler-Volmer equations"
  - "- charge from 70% state of charge at a C rate of 10"
  - "- lithium plating begins at time step 21"
  - "- monolithic evaluation of lithium plating with trigonometrical regularization for lithium stripping"
  - "- 1560 tet4 elements with matching interface nodes"
